def findSubsequenceCount(s: str, t: str) -> int:
    def f(i, j, s, t):
        if(j >= len(t)):
                return 1

        if(i >= len(s)):
                return 0

        if(s[i] == t[j]):
                return f(i + 1, j + 1, s, t) + f(i + 1, j, s, t)

        return f(i + 1, j, s, t)
    return f(0, 0, s, t)

