def kmpSearch(s: str, pattern: str) -> int:
    def computeLPSArray(pat: str, M: int, lps: list) -> None:
        length = 0
        i = 1
        while i < M:
            if pat[i] == pat[length]:
                length += 1
                lps[i] = length
                i += 1
            else:
                if length != 0:
                    length = lps[length - 1]
                else:
                    lps[i] = 0
                    i += 1

    N = len(s)
    M = len(pattern)
    lps = [0] * M
    computeLPSArray(pattern, M, lps)

    i = 0
    j = 0
    while i < N:
        if pattern[j] == s[i]:
            i += 1
            j += 1

        if j == M:
            return i - j

        elif i < N and pattern[j] != s[i]:
            if j != 0:
                j = lps[j - 1]
            else:
                i += 1

    return -1

def lastOccurrence(s: str, pattern: str) -> int:
    return kmpSearch(s, pattern[::-1])

