import heapq

def findWinner(votes: List[str]) -> str:
    count = {}
    for vote in votes:
        if vote in count:
            count[vote] += 1
        else:
            count[vote] = 1

    heap = [(-freq, name) for name, freq in count.items()]
    heapq.heapify(heap)

    winner = heapq.heappop(heap)[1]

    return winner

