def smallestStringBySwap(s1: str, s2: str) -> str:
    if len(s1) != len(s2):
        return -1

    if s1 == s2:
        seen = set()
        for c in s1:
            if c in seen:
                return c*2
            seen.add(c)
        return -1
    else:
        pairs = []
        for a, b in zip(s1, s2):
            if a != b:
                pairs.append((a, b))
        if len(pairs) != 2:
            return -1

        if pairs[0] != pairs[1][::-1]:
            return -1
        return s1[:s1.index(pairs[0][0])] + pairs[0][1] + s1[s1.index(pairs[0][0])+1:]

