def minRunLengthEncoding(s: str, k: int) -> int:
    def compute(val: int) -> bool:
        cnt = 0
        for i in range (len(s)):
            if (s[i] != val) : 
                cnt += 1
            if (cnt > k) : 
                return False
        return True
    l = 1
    r = len(s)
    while (l < r):
        mid = (l + r) // 2
        flag = False
        for i in range (len(s)):
            if ((i + mid - 1) < len(s)):
                fl = compute(s[i])
                if (fl) : 
                    flag = True
                    break
        if (flag) : 
            r = mid
        else : 
            l = mid + 1
    x = (l + r) // 2
    cnt = 0
    for i in range (len(s)):
        if (s[i] != s[i + x]) :
            cnt += 1
    return len(s) - cnt

