        for c in arr[i]:
            if c in mp:
                mp[c] += 1
            else:
                mp[c] = 1

        for c in mp:
            if (i, len(arr[i]), c) not in dp:
                dp[(i, len(arr[i]), c)] = mp[c]
            else:
                dp[(i, len(arr[i]), c)] = max(dp[(i, len(arr[i]), c)], mp[c])

    ans = 0

    for i in range(n):
        for j in range(i):
            curr = 0
            for c in arr[j]:
                if c in arr[i]:
                    if (j, len(arr[j]), c) in dp:
                        curr += dp[(j, len(arr[j]), c)]

            ans = max(ans, curr)

    return ans

def squareOfLargeNumber(num: str) -> str:
	num = int(num)
	sq = num*num
	return str(sq)

def minChanges(s: str) -> int:
    n = len(s)
    freq = [0]*26
    for i in range(n):
        freq[ord(s[i]) - ord('a')] += 1
    for i in range(26):
        if freq[i] > 1:
            k = freq[i] - 1
            n = n - k*(k + 1)//2
    return n

def findLength(string: str) -> int:
	if string == '':
		return 0
	else:
		return 1 + findLength(string[1:])

def decodeMedianString(median: str, original: str) -> str:
    decoded = ""
    for i in range(len(median)):
        diff = ord(median[i]) - ord(original[i])
        decoded += chr(ord('a') + diff)
    return decoded

def rearrangeString(s: str) -> str:
    alphabets = ''
    nums = []
    for char in s:
        if char.isalpha():
            alphabets += char
        else:
            nums.append(int(char))
    alphabets = ''.join(sorted(alphabets))
    total = sum(nums)
    return alphabets + str(total)

def uncommonChars(str1: str, str2: str) -> List[str]:
    uncommon = []
    set1 = set(str1)
    set2 = set(str2)
    for c in set1:
        if c not in set2:
            uncommon.append(c)
    for c in set2:
        if c not in set1:
            uncommon.append(c)
    return uncommon

def consecutiveCharactersTogether(s: str) -> str:
    new_str = ""
    prev_char = ""
    for char in s:
        if char != prev_char:
            new_str += char
            prev_char = char
    return new_str

from typing import List

def customSortString(order: str, s: str) -> str:
    order_dict = {order[i]:i for i in range(len(order))}

    def cmp(s1: str, s2: str):
        l1, l2 = order_dict[s1], order_dict[s2]
        if l1<l2:
            return -1
        elif l1>l2:
            return 1
        else:
            return 0

    return ''.join(sorted(s, key=lambda x: order_dict.get(x,len(order))))

def consecutiveNumbers(low: int, high: int) -> List[int]:
    result = []
    for num in range(low, high + 1):
        str_num = str(num)
        if all(int(str_num[i]) - int(str_num[i-1]) == 1 for i in range(1, len(str_num))):
            result.append(num)
    return result

def winnerOfGame(s: str) -> str:
    countA, countB = 0, 0
    for i in range(len(s)-2):
        if s[i] == s[i+1] == s[i+2]:
            if s[i] == 'A':
                countA += 1
            else:
                countB += 1
    return 'A' if countA>countB else 'B' if countB>countA else 'Draw'

def isPalindrome(s: str) -> bool:
	return s == s[::-1]

def palindromeDates(startYear: int, endYear: int) -> list:
	result=[]
	for year in range(startYear, endYear+1):
		for month in range(1, 13):
			for day in range(1, 32):
				if (day < 10 and month < 10):
					dateStr = "0" + str(day) + "0" + str(month) + str(year)
				elif (day < 10):
					dateStr = "0" + str(day) + str(month) + str(year)
				elif (month < 10):
					dateStr = str(day) + "0" + str(month) + str(year)
				else:
					dateStr = str(day) + str(month) + str(year)
				if(len(dateStr)==8):
					if (isPalindrome(dateStr)):
						result.append(f"{dateStr[2:4]}/{dateStr[0:2]}/{dateStr[4:]}")
	return result

def positionToBeRemoved(number: str) -> int:
    n = len(number)
    sum = 0
    for i in range(n):
        sum += int(number[i])
    if sum % 3 == 0:
        for i in range(n-1, -1, -1):
            if int(number[i]) % 2 == 0:
                return n-i
    else:
        return -1

def countSubstrings(s: str, c: str) -> int:
	n = len(s)
	res = 0
	cnt = 0
	for i in range(n):
		if s[i] == c:
			cnt += 1
		else:
			res += (cnt * (cnt + 1)) // 2
			cnt = 0
	if(cnt > 0):
		res += (cnt * (cnt + 1)) // 2
	return res

def minRemovals(s: str) -> int:
    n = len(s)
    count_one = 0
    count_zero = 0
    for i in range(n):
        if (s[i] != s[i % 2]):
            count_one += (s[i] == '1')
            count_zero += (s[i] == '0')
    return min(count_zero, count_one, (n - max(count_one, count_zero)))

def maxOccurringChar(s: str, queries: List[Tuple[int,int]]) -> List[str]:
	ans = []
	for query in queries:
		L, R = query
		freq = [0] * 26
		for i in range(L-1, R):
			freq[ord(s[i]) - ord('a')] += 1
		maxCountChar = ""
		maxCount = 0
		for i in range(26):
			if freq[i] > maxCount:
				maxCount = freq[i]
				maxCountChar = chr(i + ord('a'))
		ans.append(maxCountChar)
	return ans

def findWords(words: List[str]) -> List[str]:
	row1, row2, row3 = "qwertyuiop", "asdfghjkl", "zxcvbnm"
	res = []
	for word in words:
		if all(c in row1 for c in word.lower()) or all(c in row2 for c in word.lower()) or all(c in row3 for c in word.lower()):
			res.append(word)
	return res

def checkIfIntegerOrString(input) -> str:
	if isinstance(input, int):
		return "Input is an Integer"
	elif isinstance(input, str):
		return "Input is a String"
	else:
		return "Input is neither an Integer nor a String"

def removeFirstLastOccurrence(s: str, ch: str) -> str:
	firstPos = s.find(ch)
	lastPos = s.rfind(ch)
	if firstPos == -1 or lastPos == -1:
		return s
	if firstPos == lastPos:
		return s[:firstPos] + s[firstPos+1:]
	else:
		return s[:firstPos] + s[firstPos+1:lastPos] + s[lastPos+1:]

def isprime(n: int) -> bool:
	if (n == 1):
		return False
	for i in range(2, int(n**(0.5)) + 1):
		if (n % i == 0):
			return False

	return True

def primeString(s: str) -> tuple:
	summ = 0
	prod = 1
	for i in range(len(s)):
		if (s[i] >= 'a' and s[i] <= 'z'):
			summ += ord(s[i]) - ord('a') + 1
			prod *= ord(s[i]) - ord('a') + 1
	if isprime(summ):
		summ = 1
	else:
		summ = 0
	if isprime(prod):
		prod = 1
	else:
		prod = 0
	return (summ, prod)
